import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="background-paper height-100pc min-height-100vh width-100pc">
        <main>
          <div className="float-left padding-bottom-p75em padding-left-p75em padding-right-p75em padding-top-p75em min-height-100vh width-50pc">
            <div className="text-center">
                <div className="bg-color-255-239-183-p55 display-inline-block padding-bottom-p75em padding-left-p75em padding-right-p75em padding-top-p75em">
                  <h1>
                    <span>Arroz con Gandules</span>
                    <span className="display-block font-size-p5em font-weight-500">A recipe for food access in Lawrence, MA</span>
                  </h1>
                </div>
            </div>
            <p>Body of Text</p>
          </div>
          <div className="float-left padding-bottom-p75em padding-left-p75em padding-right-p75em padding-top-p75em min-height-100vh width-50pc">
            <p className="font-caveatbrush">Body of Text</p>
          </div>
        </main>
        <footer class="bg-color-10-33-47 bottom-0 position-fixed width-100pc">Hai</footer>
      </div>
    );
  }
}

export default App;
